import React from 'react';
import Menu from '../../components/Menu';
import { Breadcrumb, Container } from 'react-bootstrap';
import Titulo from '../../components/Titulo';
import TabelaHortalicas from '../../components/TabelaHortalicas';
import { Divider, Button } from 'antd';
const { Item } = Breadcrumb;

function Hortalicas() {
    const dataSource = [
        {
            key: '1',
            nome: 'Alface',
            categoria: 'Folhas',
            classificacao: '5',
            valor: '2,00'
        },
        {
            key: '2',
            nome: 'Alface',
            categoria: 'Folhas',
            classificacao: '5',
            valor: '2,00',
        },
        {
            key: '3',
            nome: 'Alface',
            categoria: 'Folhas',
            classificacao: '5',
            valor: '2,00',
        },
    ];
    return (
        <div>
            <Menu />
            <Breadcrumb>
                <Item href="/">Principal</Item>
                <Item active>Hortaliças</Item>
            </Breadcrumb>
            <Container>
                <Titulo name='Hortaliças' />
                <Divider />
                <TabelaHortalicas dataSource={dataSource}/>
                <Divider />
                <Button type='primary' href='/cadastroHortalicas'>Cadastrar</Button>
            </Container>
        </div>
    );
}

export default Hortalicas;
